import React from "react";
import { Link } from "react-router-dom";

function CreateDeckBtn() {
  return (
    <Link
      type="button"
      to="/decks/new"
      classname="btn btn-primary"
      style={{ margin: "0px 0px 20px 0px" }}
    >
      Create Deck
    </Link>
  );
}

export default CreateDeckBtn;
